import React from 'react';

class Coins extends React.Component{
    cryptoNames = [
        'Btc',
        'Eth',
        'Sol',
        'Ton',
        'Usdt',
        'Usdc',
        'Xrp',
        'Tron',
        'Avax',
        'Ada',
        'Uni',
        'Matic',
        'Dot',
        'Link'
      ];
    render() {
        for(var i = 0; i >= 15; i++){
            return <div id={cryptoNames[i]}>
                <p>{cryptoNames[i]}</p>
            </div>
        }
    }
}

export default Coins;
